import {
  MDBBtn,
  MDBCol,
  MDBInput,
  MDBRow,
} from 'mdb-react-ui-kit';
import logo from "./gopher.png";

function Layout() {
  return (
    <div className='d-flex vh-100 align-items-center justify-content-center text-center bg-dark'>
      <MDBCol className='bg-light' size='8'>
        <h2>Member Login</h2>
        <MDBRow center>
          <MDBCol size='4'>
            <div className='d-flex justify-content-center'>
              <img src={logo} alt="logo" />
            </div>
          </MDBCol>
          <MDBCol size='4'>
            <form>
              <MDBInput className='mb-4' type='email'  label='Email address'/>
              <MDBInput className='mb-4' type='password' label='Password'/>
              <MDBBtn type='submit' className='mb-4' block>Sign In</MDBBtn>
            </form>
          </MDBCol>
        </MDBRow>
      </MDBCol>
    </div>
  );
}

export default Layout;
